import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
super();

this.state = {
  name:'Renal',
  shool: 'APT'
}
  };
  render (){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Hi {this.state.name}, I   
          </p>
          <button 
          onClick={()=>{
            this.setState({name:'Dima'});
          }}
          >
            Change name</button>
        </header>
      </div>
    );
  }

}

export default App;
